import React from 'react';
import {icon1} from "./src/assets/img/icono-buscar.svg"
function SearchBar( props ) {
    
  
    return (
      <form className="container mt-11" onSubmit={props.searchMovies}>
        <input
          type="text"
          placeholder="search"
          onChange={(e) => props.functionSetSearchBar(e.target.value)}
        />
        
        <button className="social-icon"><img src="./src/assets/img/icono-buscar.svg"alt=''></img></button>
      </form>
    );
  }
export default SearchBar
